import React, { Component } from 'react';
import Header from '.././Components/Header';
import ReactPlayer from "react-player"

class Agaag extends Component {
    constructor() {
        super();
        this.state = {
        };
    }


    render() {
        return (
            <div>
                <p>AGGAG</p>
                <div className="video">
                <ReactPlayer
                    controls="true"
                    className='react-player'
                    url='https://vimeo.com/440828751'
                />
                </div>
                <div className="video">
                    <Player
                        fluid
                        src='https://vimeo.com/239351268'
                    >
                        <ControlBar autoHide={false} className="controlbar" />
                        <BigPlayButton position="center" className="playbutton" />
                    </Player>
                </div>
            </div>
        );
    }
}

export default Agaag
